  const [filteredUserList, setFilteredUserList] = useState(patientList);

  useEffect(() => {
    setFilteredUserList(patientList);
  }, [patientList]);

  const navigateToUserProfile = (user) => {
    navigation.navigate("UserProfile", { user });
  };

